<html>

<title>SetY</title>

<body>
<h1>SetY</h1>
<code>SetY(<b>float</b> y)</code>
<h2>Description</h2>
Moves the current abscissa back to the left margin and sets the ordinate. If the passed value
is negative, it is relative to the bottom of the page.
<h2>Parameters</h2>
<dl class="param">
<dt><code>y</code></dt>
<dd>
The value of the ordinate.
</dd>
</dl>
